script: |
  super -f text -I q8601.spq | sort > q8601.out

inputs:
  - name: q8601.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE ( + col0 * + col0 ) NOT BETWEEN + col1 + col2 AND + 98;
  - name: tab1

outputs:
  - name: q8601.out
    data: |
      51	14	96
      85	5	59
      91	47	68
